[CVE-2020-0712] An uninitialized memory usage error in the latest Microsoft Edge 44.18362.387.0 may be exploited to execute arbitrary code. - Individual

```javascript
class child extends Object {
    constructor(){
        let f = () => {
            super()++
        };
        f();
    }
}
```

In above snippet, we attempt to emit a load for the target of the super call. This causes us to acquire a tmp register for the target of the super call node out-of-order relative to how the tmp registers are typically acquired in `EmitSuperCall`. Then later when we release the call target location we notice that the tmp registers are being released out-of-order. Fix is to skip emitting the call target when emitting a load of a super call node - this is already handled by `EmitSuperCall` so it isn't necessary anyway.

[MERGE #6319 @pleath] Reimplement class definitions to limit type creation

Merge pull request #6319 from pleath:class

Change the byte codes and jitted code we emit for class definitions to do the following:
- Fix a functional issue involving order of member initializations;
- Stop reloading the class prototype object when doing member initializations. Instead, give byte code direct access to the prototype and constructor objects that are created when we initialize a class;
- Create the right constructor type and type handler all at once instead of going through the stages of deferred type, simple type, path type, etc. There's no point in using a deferred type, since we know we'll immediately access the prototype field. And if we initialize the simple type properly, we don't need to use a path type.

[MERGE #6242 @boingoing] Fix environment calculation for symbol captured in the param scope

Merge pull request #6242 from boingoing:23102586

Consider this repro:

```javascript
function test0() {
  var k;

  function foo(a = function() { +k; }) {
      a();
      function bar() { a }
  };

  eval('')
  foo();
}
test0();
```

We're hitting a miscalculation of the environment index when we're attempting to look up the scope for symbol 'k'. In particular, the miscalculation occurs in ByteCodeGenerator::FindScopeForSym. In this function, we walk up the scope chain starting from the body scope of the anonymous function declared in the param scope of foo. Each scope we walk to for a function other than the anonymous function which requires instantiation will increment the environment index. The enclosing scope for the anonymous function body scope is the param scope of foo and the body scope of foo is not in the restored scope chain. When we walk to the param scope for foo, it does not have the must instantiate flag set so we (incorrectly) do not increment the environment index. Back when the body scope for foo was incorrectly enclosing the body scope of the anonymous function, we correctly calculated the environment index because the body scope for foo has the must instantiate flag set. Now that param scope for foo is in the scope chain instead of body scope, we need to mark the param scope as must instantiate so this lookup is correct.

